def writeJSON(games,filename):
	feeds = []
	with open(filename, 'a+') as past_contents:
	    entry = json.dumps(games)
	    feeds.append(entry)
	    json.dump(feeds, past_contents)
	return entry

def processRows(allrows):
	i = 1
	games = []
	for item in allrows:
		if i > 2:
			row = BeautifulSoup(str(item))
			score = row.find("li", { "class" : "score" })
			link = score.find('a', href=True)
			gameid = link['href'][18:]
			if gameid.isdigit():
				games.append(int(gameid))
		i+=1
	return games	

